import React from "react";

import USAMap from "react-usa-map";
import { Component } from "react";
import "./LandingPage.css";
import { useNavigate } from "react-router-dom";

function LandingPage() {
  const navigate = useNavigate();
  class Map extends Component {
    // This function is required by imported USAMap
    mapHandler = (event) => {
      let stateName = event.target.innerHTML
        .replace("<title>", "")
        .replace("</title>", "");
      navigate("/state", {
        state: { stateName: stateName, stateCode: event.target.dataset.name },
      });
    };

    render() {
      return (
        // This is a imported component that provides a clickable map of the United States
        <USAMap onClick={this.mapHandler} defaultFill="rgb(247, 166, 15)" />
      );
    }
  }

  return (
    <div className="landing-page-container">
      <div className="logo-container">
        {/* <div class="item">
          <div class="circle">
            <div class="item-icon">
              <span class="material-symbols-outlined size-36">100%</span>
            </div>
          </div>
          <div class="text">
            <h4>USA</h4>
            <p>Halal Chains</p>
          </div>
        </div> */}
        <h1>Geeks For Geeks</h1>

        <div class="container">
          <svg
            viewBox="0 0 500 500"
            preserveAspectRatio="xMinYMin meet"
            style="z-index: -2;"
          >
            <path
              d="M0, 100 C150, 200 350,
                0 500, 100 L500, 00 L0, 0 Z"
              style="stroke: none; 
                fill:rgba(30, 144, 225, 0.5);"
            ></path>
          </svg>
        </div>

        <div class="container">
          <svg
            viewBox="0 0 500 500"
            preserveAspectRatio="xMinYMin meet"
            style="z-index:-1;"
          >
            <path
              d="M0, 80 C300, 0 400, 
                300 500, 50 L500, 00 L0, 0 Z"
              style="stroke: none; 
                fill:rgba(153, 50, 204, 0.5);"
            ></path>
          </svg>
        </div>

        <div class="container">
          <svg
            viewBox="0 0 500 500"
            preserveAspectRatio="xMinYMin meet"
            style="z-index:-3;"
          >
            <path
              d="M0, 100 C150, 300 350,
                0 500, 100 L500, 00 L0, 0 Z"
              style="stroke: none; 
                fill:rgba(220, 20, 60, 0.5);"
            ></path>
          </svg>
        </div>
      </div>

      <h1>Click on a state to view its national halal spots!</h1>
      <Map />
    </div>
  );
}

export default LandingPage;
